INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Dostawa', 'Dostawa', 'Nasze zasady i warunki dostawy', 'conditions, delay, shipment, pack, dostawa, warunki, opóźnienie, wysyłka, paczka', '<h2>Wysyłki i zwroty</h2>\r\n<h3><span style=\"font-size:12.87px;\">Twoja paczka</span></h3>\r\n<p>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i są wysyłane za pośrednictwem firmy UPS ze śledzeniem i nadawaniem bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Bez względu na to, jakiego rodzaju przesyłki wybierzesz, otrzymasz od nas link do śledzenia przesyłki online.</p>\r\n<p></p>\r\n<p>Opłaty za wysyłkę obejmują opłaty manipulacyjne i koszty pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Zalecamy zgrupowanie artykułów w jednym zamówieniu. Nie możemy zgrupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą naliczane dla każdego z nich. Paczka zostanie wysłana na własne ryzyko, ale należy zachować szczególną ostrożność w celu ochrony delikatnych przedmiotów.</p>\r\n<p></p>\r\n<p>Pudełka są pokaźnych rozmiarów, a Twoje przedmioty są dobrze chronione.</p>', 'dostawa'),
(2, 1, 1, 'Nota prawna', '', 'Nota prawna', 'notice, legal, credits, zauważ, legalnie, leganle, kredyty, prawo, prawne', '<h2>Prawny</h2>\r\n<h3>Kredyty</h3>\r\n<p>Koncepcja i produkcja:</p>\r\n<p>Ta witryna internetowa została utworzona przy użyciu oprogramowania typu open source PrestaShop™.</p>', 'nota-prawna'),
(3, 1, 1, 'Regulamin użytkowania', '', 'Nasz regulamin użytkowania', 'conditions, terms, use, sell, regulamin, użytkowanie, sprzedaż', '<h2>Regulamin użytkowania</h2>\r\n<h3>Nasze regulaminy użytkowania:</h3>', 'regulamin-uzytkowania'),
(4, 1, 1, 'O nas', '', 'Dowiedź się więcej o nas', 'about us, informations, o nas, informacja', '<h2>O nas</h2>\r\n<h3>Sklep internetowy Kino</h3>', 'o-nas'),
(5, 1, 1, 'Bezpieczna płatność', '', 'Bezpieczna płatność znaczy', 'secure payment, ssl, visa, mastercard, paypal', '<h2>Bezpieczna płatność</h2>\r\n<h3>Nasza bezpieczna płatność</h3>\r\n<p>Płać za pomocą SSL</p>\r\n<h3>Wykorzystuj Visa/Mastercard/Paypal</h3>', 'bezpieczna-platnosc');
