INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(46, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(77, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(68646, 1, 1, 'Wersja zremasterowana i odrestaurowana z okazji 50-tej rocznicy powstania Ojca Chrzestnego. Arcydzieło sztuki filmowej - mistrzowska adaptacja sagi Mario Puzo w reżyserii Francisa Forda Coppoli to wyrazisty i poruszający portret sycylijskiej rodziny, która desperacko stara się zachować swoje wpływy w pełnej korupcji, oszustw i zdrady powojennej Ameryce. Zobacz obraz, który przez wielu określony został najlepszym amerykańskim filmem wszech czasów! W skład zremasterowanej i odnowionej trylogii wchodzą nagrodzone Oscarem® za Najlepszy Film obrazy: Ojciec Chrzestny i Ojciec Chrzestny II oraz Ojciec Chrzestny Mario Puzo, Epilog: Śmierć Michaela Corleone - odnowiona przez reżysera w 2020 roku ostatnia część trylogii. Bonusowa płyta Blu-ray zawiera godziny materiałów dodatkowych oraz niepublikowane wcześniej treści z nowym spojrzeniem na filmowe dziedzictwo.', '', 'the-godfather', '', '', '', 'The Godfather', '', '', '', ''),
(83944, 1, 1, '', '', 'rambo-first-blood', '', '', '', 'Rambo Trilogy: Rambo First Blood / Rambo II / Rambo III 3xBlu-Ray 4K', '', '', '', ''),
(91203, 1, 1, 'Connor MacLeod jest nieśmiertelny. To jego dar i przekleństwo. Raniony w walkach nie ginie, ale musi patrzeć jak przemijają jego ukochani. Od ponad 400 lat tuła się po świecie tocząc pojedynki, walcząc w bitwach i obserwując zmienne koleje historii. Wie, że gdzieś u kresu tej drogi czeka go najważniejsza walka z ostatnim z nieśmiertelnych. Zasada jest prosta: nieśmiertelni na przestrzeni wieków walczą ze sobą, eliminując się nawzajem. Ostatni dwaj stoczą zaś bój o Wielką Nagrodę. Jest koniec XX wieku, Nowy Jork, Connor już wie, że zostało ich tylko dwóch. Zbliża się ostateczne rozstrzygnięcie.', '', 'highlander', '', '', '', 'Highlander Blu-Ray 4K', '', '', '', ''),
(91369, 1, 1, '', '', 'labyrinth', '', '', '', 'Labyrinth', '', '', '', ''),
(99487, 1, 1, '', '', 'edward-scissorhands', '', '', '', 'Edward Scissorhands', '', '', '', ''),
(99785, 1, 1, 'Pakiet dwóch kultowych filmów o perypetiach Kevina McCallistera (Macaulay Culkin) i gamoniowatych włamywaczy (Joe Pesci i Daniel Stern). W pierwszej części próbują obrabować McCallissterów,  pod nieobecność rodziców. Z kolei w drugiej części akcja przenosi się do Nowego Jorku, gdzie złodzieje planują swój wielki skok. Bez tych filmów nie obejdzie się żaden świąteczny seans filmowy!', '', 'home-alone-home-alone-2-lost-in-new-york', '', '', '', 'Home Alone + Home Alone 2: Lost In New York', '', '', '', ''),
(107688, 1, 1, 'Cyfrowo odnowiona i zremasterowana przy użyciu najnowocześniejszych technologii wersja „Miasteczka Halloween” to zachwycająca uczta dla oczu i uszu wszystkich miłośników Tima Burtona i jego mrocznej wyobraźni. Król Miasteczka Halloween, Jack Skellington, znudzony codziennym straszeniem trafia przypadkiem do Miasteczka Bożego Narodzenia i dla odmiany postanawia zająć się szerzeniem wesołego nastroju świąt. W wyniku jego radosnej misji Święty Mikołaj znajdzie się w niebezpieczeństwie, a same święta dla wszystkich dzieci zamienią się w koszmar! Poddaj się magii wyjątkowej muzyki skomponowanej przez Danny’ego Elfmana i zobacz, jak fantastyczne postacie stworzone przez Tima Burtona i Henry’ego Selicka ożywają na ekranie dzięki wysokiej jakości obrazu i dźwięku Blu-ray. „Miasteczko Halloween”, teraz jeszcze bardziej upiorne i wyjątkowe, to wspaniała rozrywka dla tych, którzy uwielbiają się bać!', '', 'the-nightmare-before-christmas', '', '', '', 'The Nightmare Before Christmas', '', '', '', ''),
(111161, 1, 1, 'Wybitna adaptacja opowiadania Stephena Kinga, nominowana do siedmiu nagród Akademii Filmowej? teraz w doskonałej jakości obrazu i dźwięku 4K UHD. Skazany na dożywocie Red (Morgan Freeman) doskonale zna więzienie Shawshank. Nowy więzień Andy (Tim Robbins) przynosi nadzieję i odmianę wszystkim więźniom.', '', 'the-shawshank-redemption-4k', '', '', '', 'The Shawshank Redemption 4K', '', '', '', ''),
(120737, 1, 1, 'Po raz pierwszy w najwyższej jakości 4K UHD. Ponadczasowa trylogia zdobywcy Nagrody Akademii, reżysera Peter Jacksona. Trzy filmy: Władca Pierścieni: Drużyna Pierścienia, Władca Pierścieni: Dwie Wieże oraz Władca Pierścieni: Powrót Króla, w edycjach kinowych i rozszerzonych.', '', 'lord-of-the-rings-the-motion-picture-trilogy-extended-edition', '', '', '', 'The Lord of the Rings: The Motion Picture Trilogy 4K', '', '', '', ''),
(133093, 1, 1, '', '', 'the-matrix', '', '', '', 'The Matrix', '', '', '', ''),
(499549, 1, 1, 'Oczekiwany z ogromnym zainteresowaniem pierwszy od czasu \"Titanica\" film Jamesa Camerona. Zrealizowana z niezwykłym rozmachem - w nowej technice kina trójwymiarowego - opowieść o komandosie, który uwikłany zostaje w wojnę dwóch pozaziemskich cywilizacji. W rolach głównych: Sigourney Weaver, Michelle Rodriguez (serial TV \"Zagubieni\"), Giovanni Ribisi (\"Szeregowiec Ryan\"), Wes Studi (\"Tańczący z wilkami\"), Zoe Saldana (\"Terminal\") i CCH Pounder (\"Bagdad Café\")., Bohater, który wcale nie chce nim być. Niezwykła wyprawa. Wielka przygoda. Wybór pomiędzy życiem, które zostawił a niezwykłym nowym światem, który poznaje i uczy się nazywać swoim domem. Oto AVATAR Jamesa Camerona - najwspanialszy przygodowy film wszech czasów.', '', 'avatar', '', '', '', 'Avatar', '', '', '', ''),
(1028532, 1, 1, 'Profesor Wilson (Richard Gere) znajduje na stacji kolejowej uroczego, puchatego szczeniaka rasy Akita. Zabiera go do domu,, aby udzielić schronienia aż do chwili, kiedy zgłosi się po niego właściciel. Jednak nikt nie poszukuje psiaka, a rodzina, profesora szybko przyzwyczaja się do obecności puchatej kulki. Pies dostaje na imię Hachiko, wyrasta na dużego i mądrego, czworonoga, który staje się najwierniejszym i najbardziej oddanym przyjacielem profesora. Codziennie rano odprowadza go, na stację, a po południu czeka na niego na peronie. Ten rytuał powtarza się przez lata, dzień w dzień, niezależnie od pory, roku i pogody. Ale pewnego dnia profesor nie wraca z pracy... Od tego dnia Hachiko daje dowód tak wielkiej miłości i, wierności wobec swego pana, że legenda o tym najlepszym z przyjaciół trwa po dziś dzień.', '', 'hachi-a-dog-s-tale', '', '', '', 'Hachi: A Dog\'s Tale', '', '', '', ''),
(1160419, 1, 1, 'Hit kinowy 2021 roku! Wizualno-muzyczne arcydzieło z gwiazdorską obsadą. Diuna to widowiskowa ekranizacja kultowej powieści Franka Herberta przedstawiająca dzieje krainy Arrakis, zwanej Diuną. Z rozkazu Padyszacha Imperatora planetę przejmują Atrydzi, zaciekli wrogowie władających nią dotychczas Harkonnenów. Zwycięstwo księcia Leto Atrydy jest jednak pozorne - przejęcie planety zostało bowiem ukartowane.', '', 'dune-4k', '', '', '', 'Dune 4K', '', '', '', ''),
(1745960, 1, 1, 'Po ponad trzydziestu latach w służbie amerykańskiej marynarki wojennej, jej czołowy pilot, Pete \"Maverick\" Mitchell jest tam, gdzie być powinien. Jako mistrz w swoim fachu testuje najnowocześniejsze maszyny. Kiedy powraca do TOP GUN, by wyszkolić elitarną grupę absolwentów musi zmierzyć się z duchami przeszłości i stanąć twarzą w twarz z porucznikiem Bradshawem, synem swojego zmarłego przyjaciela \"Goose\'a\". Zaciekła rywalizacja wybucha, gdy piloci przygotowują się do misji. Od wybranych będzie ona wymagała największego poświęcenia.', '', 'top-gun-maverick', '', '', '', 'Top Gun: Maverick 4K Gold steelbook', '', '', '', ''),
(2382320, 1, 1, 'James Bond opuszcza czynną służbę i cieszy się spokojnym życiem na Jamajce. Tymczasem jednak jego stary przyjaciel Felix Leiter z CIA zwraca się do niego o pomoc. Misja uratowania porwanego naukowca okazuje się o wiele bardziej zdradliwa, niż mogłoby się wydawać i naprowadza agenta 007 na ślad tajemniczego złoczyńcy, dysponującego nową, niezwykle niebezpieczną technologią.', '', 'no-time-to-die', '', '', '', 'No Time to Die', '', '', '', ''),
(2709692, 1, 1, 'Illumination i Universal Pictures przedstawiają film \"Grinch\", oparty na klasycznej opowieści Dr. Seussa. To historia cynicznego tetryka, który postanawia ukraść Boże Narodzenie, ale pod wpływem małej dziewczynki ulega cudownej metamorfozie. Zabawny, ciepły i porywający \"Grinch\" oferuje zabawę dla całej rodziny!', '', 'the-grinch', '', '', '', 'The Grinch', '', '', '', ''),
(2953050, 1, 1, 'Witaj w \"Naszym magicznym Encanto\", pełnym porywających do tańca piosenek nagradzanego Lin-Manuela Mirandy! Ta bajecznie kolorowa produkcja Walt Disney Animation Studios przeniesie Cię w góry Kolumbii, gdzie w magicznym domu mieszka niezwykła rodzina Madrigal. Gdy zaczyna jej zagrażać nieznane niebezpieczeństwo ostatnią nadzieją okaże się Mirabel - jedyna z rodziny nieposiadająca magicznych mocy.', '', 'encanto', '', '', '', 'Encanto', '', '', '', ''),
(3480822, 1, 1, '', '', 'black-widow', '', '', '', 'Black Widow', '', '', '', ''),
(4587656, 1, 1, 'Mały, lecz dzielny osiołek Bo tęskni za życiem z dala od codziennej harówki w wiejskim młynie. Któregoś dnia zbiera się na odwagę i wyrywa na wolność. W podróży towarzyszy mu urocza owieczka Ruth, która przypadkowo odłączyła się od stada i wesoły gołąb Dave o wielkich aspiracjach. Razem z zabawnymi wielbłądami oraz innymi nieco ekscentrycznymi zwierzętami, Bo i jego nowi przyjaciele podążają za gwiazdą, na spotkanie przygody marzeń, by wkrótce stać się bohaterami najwspanialszej opowieści wszech czasów.Materiały dodatkowe w wersji oryginalnej:? Śpiewaj razem z Bo i przyjaciółmi? Tańcz do ?Life Is Good\" A Great Big World ? Teksty piosenek, które wykonują: Mariah Carey, Fifth Harmony, A Great Big World, Kelsea Ballerini, Kirk Franklin? DeVon Franklin: ?Wiara przez cały rok\"', '', 'the-star', '', '', '', 'The Star', '', '', '', ''),
(5113044, 1, 1, 'Późniejszy pan zła - Gru ma teraz 12 lat, mieszka na przedmieściach i w piwnicy knuje, jak zapanować nad światem. Kiedy niesławna grupa złoczyńców, o nazwie Straszliwa 6, pozbywa się swojego przywódcy, Gru próbuje wstąpić w jej szeregi. Staje się jednak jej śmiertelnym wrogiem i musi ratować się ucieczką. Pomagają mu w tym Minionki, które próbują opanować sztuki walki, aby stanąć w jego obronie. Gru tymczasem odkrywa, że nawet źli ludzie czasem potrzebują przyjaciół. Pełna humoru animacja Minionki: wejście Gru jest jeszcze bardziej emocjonująca niż wszystkie poprzednie części razem wzięte!', '', 'minions-the-rise-of-gru', '', '', '', 'Minions: The Rise of Gru', '', '', '', ''),
(5268648, 1, 1, 'Cztery lata po spektakularnym sukcesie \"Listów do M.\" bohaterowie najpopularniejszej komedii wyświetlanej w polskich kinach w ciągu ostatnich 25 lat powracają. Listy do M. 2 mają w sobie wszystko to, za co pierwszy film pokochały miliony Polaków - światowy poziom realizacyjny, przebojową ścieżkę dźwiękową, wciągającą historię, błyskotliwy humor, prawdziwe wzruszenia i jeszcze więcej gwiazd w obsadzie. Tę najbardziej romantyczną komedię 2015 roku zobaczyło w kinach blisko 3 miliony widzów. Bohaterowie komedii świątecznej produkcji TVN rozśmieszają, wzruszają i inspirują do tego by uwierzyć, że w święta wszystko jest możliwe i że to właśnie miłość jest najlepszym prezentem pod choinkę. Tomasz Karolak, Maciej Zakościelny, Roma Gąsiorowska, Maciej Stuhr, Agnieszka Dygant, Piotr Adamczyk, Magdalena Lamparska, Małgorzata Kożuchowska, Marta Żmuda Trzebiatowska, Agnieszka Wagner, Wojciech Malajkat, Katarzyna Zielińska, Marcin Perchuć, Paweł Małaszyński, Katarzyna Bujakiewicz, Nikodem Rozbicki, Ania Matysiak i Julia Wróblewska odkrywają siłę miłości, nadziei i przebaczania w najbardziej wzruszającej komedii ostatnich lat.', '', 'listy-do-m-2', '', '', '', 'Listy do M. 2', '', '', '', ''),
(6467266, 1, 1, 'Ulubieni bohaterowie filmu Sing powracają w roztańczonej i rozśpiewanej produkcji studia Illumination! Optymistyczny koala Buster Moon i jego ekipa mają nowe, wielkie marzenie. Chcą zorganizować olśniewające show w światowej stolicy rozrywki, Redshore City. Jest tylko jeden haczyk: muszą przekonać największego rockowego outsidera, Claya Callowaya, aby do nich dołączył. Rosita, Ash, Johnny, Meena i Gunter powracają w nowym towarzystwie, wraz ze spektakularnymi przebojami w porywającym Sing 2! Poznaj niezwykłą moc muzyki, która potrafi uleczyć każde serce!', '', 'sing-2', '', '', '', 'Sing 2', '', '', '', ''),
(8041270, 1, 1, 'Przeżyj zderzenie dwóch światów w sadze rozpoczętej przez film Park Jurajski, która zatoczyła koło w Jurassic World: Dominion. Cztery lata po zniszczeniu Isla Nublar dinozaury znowu wędrują po Ziemi. To, że te prehistoryczne drapieżniki ponownie zdominowały planetę, może mieć katastrofalne konsekwencje. Dwa pokolenia bohaterów jednoczą siły. Lekarze Ellie Sattler (Laura Dern), Ian Malcolm (Jeff Goldblum) i Alan Grant (Sam Neill) powracają, dołączają do Owena Grady (Chris Pratt) i Claire Dearing (Bryce Dallas Howard) i przeżywają niesamowitą przygodę, która raz na zawsze zadecyduje o losie ludzi i dinozaurów.', '', 'jurassic-world-dominion', '', '', '', 'Jurassic World Dominion', '', '', '', ''),
(10648342, 1, 1, 'Więcej Thorów, więcej gromów! W filmie Marvel Studios \"Thor: Miłość i grom\" Bóg Piorunów (Chris Hemsworth) łączy siły z Walkirią, Korgiem i byłą dziewczyną Jane Foster (Natalie Portman), która stała się Potężną Thor. Razem muszą się zmierzyć z galaktycznym mordercą znanym jako Gorr Bogobójca (Christian Bale).', '', 'thor-love-and-thunder', '', '', '', 'Thor: Love and Thunder', '', '', '', ''),
(11832046, 1, 1, 'Psi Patrol wkracza do akcji? w swojej największej filmowej przygodzie!Humdinger, rywal psiaków i czarny charakter, zostaje burmistrzem Miasta Przygód i zaczyna siać w nim zamęt. Ryder i bohaterskie szczeniaki wrzucają wyższy bieg i stawiają czoła najtrudniejszej misji w swojej karierze. Znajdują nowego sojusznika, bystrego jamnika Liberty, i razem ruszają do akcji, by ocalić mieszkańców Miasta Przygód! Czy Psi Patrol zdoła ich uratować, zanim będzie za późno? W końcu żadne miasto nie jest za duże, ani żaden szczeniak nie jest za mały!', '', 'paw-patrol-the-movie', '', '', '', 'PAW Patrol: The Movie', '', '', '', ''),
(11871074, 1, 1, 'WIELKI PRZEBÓJ KINOWY, KTÓRY OBEJRZAŁO PONAD MILION WIDZÓW W POLSCE!Film petarda, który odsłania hipokryzję polskiego show-biznesu i ujawnią całą prawdę na temat \"afery dubajskiej\", w którą zamieszane były celebrytki, modelki, jak i znane postaci ze świata polityki, sportu czy biznesu.Emi to młoda ambitna dziewczyna, która od lat marzy o wielkim świecie. Gdy tylko nadarza się okazja, bez wahania wskakuje w jego tryby, stając się ekskluzywną damą do towarzystwa. Wkrótce to ona na zaproszenie arabskich szejków zaczyna werbować polskie miss, celebrytki, gwiazdy ekranu i modelki. Jednak ten niedostępny, opływający w luksusy świat już niedługo pokaże swoją mroczną stronę?', '', 'dziewczyny-z-dubaju', '', '', '', 'Dziewczyny z Dubaju', '', '', '', ''),
(12412888, 1, 1, 'Ulubiony niebieski jeż powraca w kolejnej przygodzie - SONIC 2: SZYBKI JAK BŁYSKAWICA. Po osiedleniu się w Green Hills, Sonic za wszelką cenę chce udowodnić, że może być prawdziwym bohaterem. Już wkrótce nadarza się ku temu okazja, ponieważ powraca Doktor Robotnik, tym razem ze swoim nowym pomocnikiem, Knucklesem. Ich nikczemny plan zakłada odnalezienie szmaragdu, który ma moc niszczenia cywilizacji. Sonic łączy siły z nowym przyjacielem Tailsem i wspólnie wyruszają w podróż, aby wpaść na trop szmaragdu, zanim trafi w niepowołane ręce.', '', 'sonic-the-hedgehog-2', '', '', '', 'Sonic the Hedgehog 2', '', '', '', ''),
(12593682, 1, 1, '', '', 'bullet-train', '', '', '', 'Bullet Train', '', '', '', ''),
(13162484, 1, 1, 'Listy do M. 4 to nowa odsłona serii, której pierwsze trzy części przyciągnęły do kin blisko 9 milionów widzów. Uwielbiani bohaterowie wracają. Ich losy znów splotą się w przeddzień Bożego Narodzenia, a nowe postaci wywrócą ich życie do góry nogami.Gdy zbliża się Wigilia, wszystko może się zdarzyć! Nieoczekiwane zauroczenie, przerwane zaręczyny czy nieplanowane spotkanie sprawią, że bohaterowie na nowo będą musieli zdefiniować, czym jest dla nich \"miłość do bliźniego\". Świat Mela, Szczepana, Kariny i Wojciecha znów stanie na głowie? Między Karolinę i Filipa wkroczy nowa kobieta, a o Rudolfa upomni się przeszłość. W tym czasie nawet nieśmiały introwertyk wyjdzie z domu, a zbuntowany pechowiec okaże się muzycznym diamentem. Święta to magia, wystarczy dać jej szansę!', '', 'listy-do-m-4', '', '', '', 'Listy do M. 4', '', '', '', ''),
(13162485, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(13162486, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
(13162487, 1, 1, '', '', '', '', '', '', '', '', '', '', ''),
